export const releases = require ('../assets/icons/releases.png');
export const feeds = require ('../assets/icons/feeds.png');
export const catalog = require ('../assets/icons/sneakers.png');
export const favorite = require ('../assets/icons/heart.png');
export const news = require ('../assets/icons/newspaper.png');
export const search = require ('../assets/icons/search.png');
export const tag = require ('../assets/icons/shopping.png');
export const like = require ('../assets/icons/like.png');
export const comment = require ('../assets/icons/chat.png');
export const add = require('../assets/icons/add.png');
export const dropdown = require('../assets/icons/dropdown.png');
export const exit = require('../assets/icons/exit.png');
export const back = require('../assets/icons/back.png');

const icons = {
    profile, 
    notification, 
    releases,feeds, 
    catalog, 
    favorite, 
    news, 
    search,
    tag, 
    like, 
    comment,
    add,
    dropdown,
    exit,
    back
};

export default icons;
